import React, { useEffect, useRef } from "react";
import L from "leaflet";
import "leaflet/dist/leaflet.css";
import "leaflet-routing-machine/dist/leaflet-routing-machine.css";
import "leaflet-routing-machine";
import "./MapComponent.css";

// Fix for Leaflet icon path (Method 1)
delete L.Icon.Default.prototype._getIconUrl;

L.Icon.Default.mergeOptions({
  iconRetinaUrl: require("leaflet/dist/images/marker-icon-2x.png"),
  iconUrl: require("leaflet/dist/images/marker-icon.png"),
  shadowUrl: require("leaflet/dist/images/marker-shadow.png"),
});

const MapComponent = ({ logsData, tripId }) => {
  const mapRef = useRef(null);
  const mapInstance = useRef(null);

  useEffect(() => {
    const createMap = async () => {
      if (!mapRef.current) return; // Handle null mapRef.current and only continue if present

      const existingMap = L.DomUtil.get("map");
      if (!existingMap?._leaflet_id) {
        const map = L.map(mapRef.current, {
          center: [40.7128, -74.006],
          zoom: 6, // Increased zoom out for better visibility of longer routes
          scrollWheelZoom: false,
        });

        L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png", {
          attribution:
            '© <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors',
        }).addTo(map);

        if (logsData != null && logsData.length > 0) {
          const startLog = logsData?.[0];
          const pickupLog = logsData?.[9];
          const dropoffLog = logsData?.[10];

          if (!startLog || !pickupLog || !dropoffLog) {
            console.error(
              "Missing log entries for start, pickup, or dropoff location.  Length of the logs is:",
              logsData.length
            );
            return;
          }

          const startCoords = [startLog.latitude, startLog.longitude];
          const pickupCoords = [pickupLog.latitude, pickupLog.longitude];
          const dropoffCoords = [dropoffLog.latitude, dropoffLog.longitude];

          // Add intermediate location markers
          logsData.map((log, index) => {
            if (index !== 0 && index !== 9 && index !== 10) { // Exclude start, pickup, and dropoff locations
              return L.marker([log.latitude, log.longitude])
                .addTo(map)
                .bindPopup(`${log.location}<br>Duty Status: ${log.duty_status}<br>Remarks: ${log.remarks}`);
            }
            return null;
          }).filter(waypoint => waypoint !== null);

          // Create Routing Control (with intermediate waypoints)
          L.Routing.control({
            waypoints: [
              L.latLng(startCoords),
              L.latLng(pickupCoords),
              L.latLng(dropoffCoords),
            ],
            routeWhileDragging: false,
            showAlternatives: false,
            serviceUrl: "http://router.project-osrm.org/route/v1",
          }).addTo(map);
        }

        mapInstance.current = map;
      } else {
        console.log("Map already initialized, skipping initialization.");
      }
    };

    createMap();

    return () => {
      if (mapInstance.current) {
        mapInstance.current.remove();
        mapInstance.current = null;
      }
    };
  }, [logsData]);

  return <div id="map" ref={mapRef} style={{ height: "500px" }}></div>;
};

export default MapComponent;
